import './App.css';
import {BrowserRouter, Route, Switch} from 'react-router-dom'
import LandingPage from './components/Landing';


function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Switch>
        <Route exact path='/' component={LandingPage}/>
      </Switch>
      <h1>Henry Food</h1>
    </div>
    </BrowserRouter>
  );
}

export default App;
